import './App.css'
import React, { PureComponent } from 'react'
import CryptoBanner from './banner'

/*
function App() {
  return (
    <div className="App">
      <div class="header">
        <CryptoBanner />
        <h1>ERC-20 Name Service Registrar</h1>
      </div>
    </div>
  )
}
*/

class App extends PureComponent {

  render () {
    return (
      <div className="App">
        <div class="header">
          <CryptoBanner />
          <h1>ERC-20 Name Service Registrar</h1>
        </div>
      </div>
    )   
  }
}

export default App
